import React, { Component } from 'react'
import { EVENTS } from '../../constants/constants';
class PeakMonth extends Component {
    render() {
        if (this.props.swimmerData == null) {
            return (
                <div name="PeakMonth"> </div>
            )
        } else {

            let allData = this.props.swimmerData;
            let data = []
            // * Need to process data from Workbook -> Worksheets -> Event -> Swimmers
            allData.forEach(Workbook => {
                // * In every Workbook (Age / Year) it holds Sheets with the events, will select the sheet that has the event
                let Sheet = [EVENTS.indexOf(this.props.event)];
                // * For every Event Sheet only query the events that you want data from. Passed on event passed from clubs form
                Sheet.forEach(swimmer => {
                    data.push(swimmer);
                })
            })
            return (
                <div>workings</div>
            )
        }
    }
}
export default PeakMonth;
